    return (

        <div id="header">
            <nav id="nav-menu-container">
        <ul className="nav-menu">
          <li>
            <NavLink exact to="/" activeStyle={isActive}>Home</NavLink></li>
            <li><NavLink to="/about" activeStyle={isActive}>About Us</NavLink></li>
            </ul>  </nav>

        </div>
    )
}
